svg.script:
function ShowData(pathClass,svgNodeID)
{
if(pathClass=="triangleGPS"){
window.parent.location.href='/commFactor/Comm_Factor3.aspx?id=9&sensor_id='+svgNodeID;
}else if(pathClass=="squareWater"){
window.parent.location.href='/commFactor/Comm_Factor1.aspx?id=17&sensor_id='+svgNodeID;
}else if(pathClass=="rectangleRain"){
window.parent.location.href='/commFactor/Comm_Factor1.aspx?id=6&sensor_id='+svgNodeID;
}else if(pathClass=="circleStickCX"){
window.parent.location.href='/commFactor/Deep_Displacement.aspx?sensor_id='+svgNodeID;
}
}
